import React from 'react';
import { Route, Routes } from 'react-router-dom';
import SearchApp from './pages/SearchApp';

function App() {
  return (
    <Routes className="App">
      <Route exact path="/" element={SearchApp}></Route>
    </Routes>
  );
}

export default App;
